            %
            obj.h_array((obj.n_x*obj.N+1):(obj.n_x*obj.N+obj.n_psi)) = [  z(1,1)-obj.X_0(1),...
                                                                      z(1,2)-obj.X_0(2),...
                                                                      z(1,3)-obj.X_0(3),...
                                                                      z(1,4)-obj.X_0(4),...
                                                                    z(end,1)-obj.X_T(1),...
                                                                    z(end,2)-obj.X_T(2),...
                                                                                      0,...
                                                                                      0];
        end

        %% Funtion für fmincon
        % Nichtlineare Beschränkungen
        function [c,ceq] = nonlcon(obj,z)
            obj.G(z); 
            obj.H(z);
            c = obj.g_array; 
            ceq = obj.h_array;
        end
